window.bookSummaryJSON = "<p>Ender Hemsworth has been called many things: Cock on Legs. Captain of Sigma Chi. Big man on campus. Star athlete at UC Berkeley. And he's always scowling like someone took a piss in his Cheerios. </p> <p>Adelaide Vikander has been called one thing: Twenty Types of Trouble. And she likes to take the proverbial \"piss\" in Ender's Cheerios. </p> <p>When they're forced to live together off campus, sparks fly and panties drop. Will Ender, the cold and unfeeling \"Cock on Legs\" grow a torso, a head, and a warm, beating heart? </p>"; 
